import './App.css';
import {
  HashRouter as Router,
  Routes, 
  Route
} from 'react-router-dom';
import HomePage from './Homepage';

function App() {
  return (
    <Routes> 
        <Route
          path="/"
          element={<HomePage />} 
        />
      </Routes>
  );
}

export default App;
